import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";
import App from "./App";

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(<App />);

fetch(
  "https://api.rawg.io/api/games?key=d0fe4ae2d91e4d78953d1fbde5166610&genres=action&size=2"
)
  .then((response) => response.json())
  .then((data) => console.log(data));

const asyncFunc = async () => {
  const response = await fetch(
    "https://api.rawg.io/api/genres?key=d0fe4ae2d91e4d78953d1fbde5166610&page_size=10"
  );
  const data = await response.json();
  const { results } = data;
  const names = results.map((game) => game.id);
  console.log(names);
};

asyncFunc();
